package leetCodeHash;

import java.util.*;

/**
 * @author Enki
 * @Version 1.0
 */
public class LeetCode_242 {
    public static void main(String[] args) {
        String s = "";
        String  t = "";
        boolean anagram = Solution.isAnagram(s, t);
        System.out.println(anagram);

    }

    static  class  Solution {
        public static boolean isAnagram(String s, String t) {
            char[] split = s.toCharArray();
            HashMap<Character, Integer> sMap = new HashMap<>();
            char[] split1 = t.toCharArray();
            HashMap<Character, Integer> tMap = new HashMap<>();
            for (char str :
                    split) {
                if (sMap.containsKey(str)) {
                    sMap.put(str, sMap.get(str) + 1);
                } else {
                    sMap.put(str, 1);
                }
            }
            for (char str :
                    split1) {
                if (tMap.containsKey(str)) {
                    tMap.put(str, tMap.get(str) + 1);
                } else {
                    tMap.put(str, 1);
                }
            }
            if (sMap.size()!=tMap.size()) return false;
            for (Map.Entry<Character, Integer> entry:
                    sMap.entrySet()
            ){

                if (!tMap.containsKey(entry.getKey())) return false;
                if (tMap.get(entry.getKey())!= entry.getValue()) return false;
            }
            return true;
        }
    }
}
